import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // My old styling, which I'll remove
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import App from './App.js'
function Choices(props) {
    // Creates an array of list item JSX elements
    let listItems = props.choices.map(function(choice) {
        return <li>{choice}</li>;});
    // Set some styling on the list note that
    // list-style-type becomes listStyleType
    let choiceStyle = {listStyleType: "lower-alpha"};
    return <ol style={choiceStyle}>
        {listItems}
        </ol>;
}
